// SPDX-License-Identifier: Unlicensed

pragma solidity ^0.8.4;

import './utils.sol';

contract minorityInterface {
    function balanceOf(address account) public view returns (uint256) {

    }
}


contract MpaMinter is ERC20 {

    // address responsoble for minting new MPA tokens, more like an admin
    address public minter;
    minorityInterface public minorityContract;
    mapping (address=>bool) blackListed;

    event MInterChanged(address indexed newMinter);

    //modifier to check minter

    modifier IsMinter() {
        require(_msgSender() == minter);
        _;
    }

    constructor (address _minorityAddress) ERC20("Minority Governance Token", "MPA") {
        minter = _msgSender();
        minorityContract = minorityInterface(_minorityAddress);
        _mint(_msgSender(), 1);
    }



    /**
     * @dev This function mints Mpa token to the provided address..
     */ 
    function mint(address receiver) public {
        require(!blackListed[receiver]);
        require(balanceOf(receiver) < 1, "account already has MPA token");
        require(minorityContract.balanceOf(receiver) > 0, "user must possess MT");
        blackListed[receiver] = true;
        _mint(receiver, 1);
    }


    function mintMany(address[] calldata receivers) public IsMinter {
        for (uint i = 0; i < receivers.length; i++) {
            require(!blackListed[receivers[i]]);
            require(balanceOf(receivers[i]) < 1, "account already has MPA token");
            require(minorityContract.balanceOf(receivers[i]) > 0);
            blackListed[receivers[i]] = true;
            _mint(receivers[i], 1);
        }

    }

    function changeMinter(address _newMinter) public onlyOwner {
        require(_newMinter != address(0), "cannot assign role to the zero address");
        minter = _newMinter;
        emit MInterChanged(_newMinter);
    }

    function decimals() public view virtual override returns (uint8) {
        return 0;
    }

}
